import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    cats: []
  }

  componentDidMount() {
    axios.get(`https://api.thecatapi.com/v1/images/search?limit=3`)
      .then(res => {
        const cats = res.data;

        this.setState({ cats});

        console.log(cats)
      })
  }

  render() {
    return (
      <ul>
        {
          //this.state.cats.map(cat =>
           //   <img src={cat.url}></img>
          //   
            //)
            <li><p>{this.state.cats.url[0]}</p></li>
        }
      </ul>
    )
  }
}
